outputDescription:
JSON with predicted class, associated confidence on that class prediction (between 0-1) and label name. Label names are returned only if the label encoding was performed by the pipeline, within AI Center. Some scikit-learn models do not support confidence scores. If the output of the optimization pipeline is a scikit-learn model which does not support confidence scores the output will only contain the predicted class. Ex: { 

  "predictions": 0,  

  "confidences": 0.6, 

  "labels": “yes”  

} 

Or if label encoding was done outside of the model: { 

  "predictions": 0,  

  "confidences": 0.6, 

}
